import React from 'react';


function ChartRow(props){
    return (
                <tr>
                    <td>{props.nombre}</td>
                    <td>{props.descripcion}</td>
                    <td>
                        <ul>
                            {props.categoria.nombreCategoria}
                        </ul>
                    </td>
                    <td>
                    <img className="w-25" src={props.ima} alt="Digital House"/>
                    </td>
                </tr>
            )
    }



export default ChartRow;
